import HJLogoMark from "../assets/logomark-white.svg";

function Header() {
  return (
    <div className="main-header-wrapper">
      <img className="HJLogoMark" src={HJLogoMark} alt="HJ Logo Mark" />;
    </div>
  );
}

export default Header;
